import React, { useState } from 'react';
import PropTypes from 'prop-types';
import unified from 'unified';
import parse from "remark-parse";
import remark2react from "remark-react";
import emoji from 'remark-emoji';
import './AnnoncesGL.css';



export default function AnnoncesGL() {
    const [text, setText] = useState(`:warning: :GL: :warning: NOUVEAUTE 2020 :warning: :GL: :warning: @everyone @Capitaines 

    :hype: Grosse nouveauté ce soir : https://gl.vivide.re/ :hype:
    
    C'est un site avec toutes les stats des parties de la GL, joueurs, équipes, etc...
    Merci à @Vivi pour tout le dev  :heart: 
    `);

    return(
        <div className="AnnoncesGL">
            <div id="preview">
                {
                    unified()
                    .use(parse)
                    .use(remark2react)
                    .use(emoji, {
                        padSpaceAfter: false,
                        emoticon: true
                    })
                    .processSync(text).contents
                }
            </div>
        </div>
    );
}
